import React from 'react'
import { Route, Redirect } from 'react-router-dom';

import Leagues from './components/Leagues/Leagues';
import Teams from './components/Teams/Teams';
import TeamSchedule from './components/Teams/TeamSchedule/TeamSchedule';
import LeagueScheduleContainer from './components/Leagues/LeagueSchedule/LeagueScheduleContainer';

import leaguesData from './data/league';
import leagueTeamsData from './data/TeamsOfLeague149';
import leagueScheduleData from './data/EventsOfLeague177';
import teamScheduleData from './data/EventsOfTeam2618';

//<Redirect from='/' to="/leagues"/>
export const Routes = (props) => { 
	return(
  		<div>
    		<Route path='/leagues' render={ () => <Leagues    leagues={props.leagues} period={props.period} search={props.search} dispatch={props.dispatch}/> }/>
    		<Route path='/leagueschedule/:league_id' render={ () => <LeagueScheduleContainer leagues={props.leagues} period={props.period} search={props.search} dispatch={props.dispatch} Data={leagueScheduleData}/>}/>
    		<Route path='/teams/:league_id' render={ () => <Teams period={props.period} search={props.search} dispatch={props.dispatch} Data={leagueTeamsData}/>}/>
    		<Route path='/teamschedule/:team_id' render={ () => <TeamSchedule period={props.period} search={props.search} dispatch={props.dispatch} Data={teamScheduleData}/>}/>
    	</div>)
}
